        super(props)
            this.state({
                settings: {
                    dots: true,
                    infinite: true,
                    speed: 500,
                    slidesToShow: 1,
                    slidesToScroll: 1
                }   
            })

    }

    render(){
        const { setting } = this.pops
        return(
            <div>
            <Slider {...settings}></Slider>
            </div>
        )
    }
}
